import Uploaded from "../../uploaded/Uploaded";
import "./home.css";

export default function Home() {
  return (
    <div className="home">
      <div className="uploaded-books">
        <p>This are the books you've uploaded so far</p>
        <img className="books" src="https://d1csarkz8obe9u.cloudfront.net/posterpreviews/action-thriller-book-cover-design-template-3675ae3e3ac7ee095fc793ab61b812cc_screen.jpg?ts=1588152105" alt="" />
        <img className="books" src="https://d1csarkz8obe9u.cloudfront.net/posterpreviews/contemporary-fiction-night-time-book-cover-design-template-1be47835c3058eb42211574e0c4ed8bf_screen.jpg?ts=1594616847" alt="" />
        <img className="books" src="https://d1csarkz8obe9u.cloudfront.net/posterpreviews/sci-fi-book-cover-template-a1ec26573b7a71617c38ffc6e356eef9.jpg?ts=1561547637" alt="" />
        <img className="books" src="https://confessionsofabookgeek.files.wordpress.com/2014/04/shatter-me.jpg" alt="" />
        <img className="books" src="" alt="" />
        <img className="books" src="" alt="" />
        <img className="books" src="" alt="" />
        <img className="books" src="" alt="" />
        <img className="books" src="" alt="" />
        <img className="books" src="" alt="" />
        <img className="books" src="" alt="" />
      </div>
    </div>
  );
}
